import PropTypes from 'prop-types'
import NewsItem from './NewsItem'

export class NewsCom extends Component {
    // constructor initialize the object(state)
  constructor(){
    super();
  }

  render() {
    return (
      <div>
        
        <div className="container">
            <h2 className='my-5' style={{textAlign:"center"}}>------  NewsFlash -- Top Headlines  ------</h2>
            <div className="row">
                <div className="col-md-4">
                    <NewsItem title="News_Title" desc="News_Description" ImageUrl="https://a4.espncdn.com/combiner/i?img=%2Fi%2Fcricket%2Fcricinfo%2F1099495_800x450.jpg"/>
                </div>
                <div className="col-md-4">
                    <NewsItem title="News_Title" desc="News_Description"  ImageUrl="https://a4.espncdn.com/combiner/i?img=%2Fi%2Fcricket%2Fcricinfo%2F1219926_1296x729.jpg"/>
                </div>
                <div className="col-md-4">
                    <NewsItem title="News_Title" desc="News_Description" ImageUrl="https://live-production.wcms.abc-cdn.net.au/d718618805e29f723e0fa707421b0079?impolicy=wcms_crop_resize&cropH=2268&cropW=4032&xPos=0&yPos=0&width=862&height=485"/>
                </div>
            </div>
        </div>
      </div>
    )
  }
}

export default NewsCom
